import React from 'react';

const Error =() =>{

    return(
        <>
        <div className="my-5 text-center">
        <h1 style={{fontSize:"80px", color:"red", marginTop:"100px"}}>404 Error</h1>
        <p style={{fontSize:"40px", marginBottom:"200px"}}>Page not found</p>
        </div>
        </>
    );
}
export default Error;
